import React from "react";
import car1 from "../../Images/car1.jpg";
import car2 from "../../Images/car2.jpg";
import car3 from "../../Images/car3.jpg";
import OwlCarousel from "react-owl-carousel";
import "owl.carousel/dist/assets/owl.carousel.css";
import "owl.carousel/dist/assets/owl.theme.default.css";
import "./Frontpage.css";

export const Frontpage = () => {
  const options = {
    rewind: true,
    autoplay: true,
    margin: 30,
    responsiveClass: true,
    nav: true,
    navText: ["<", ">"],
    smartSpeed: 1000,
    responsive: {
      0: {
        items: 1,
      },
      400: {
        items: 1,
      },
      600: {
        items: 2,
      },
      700: {
        items: 3,
      },
      1000: {
        items: 5,
      },
    },
  };

  return (

    <div>
  <div className="owl-carousel owl-theme">
    <div className="owl-slide d-flex align-items-center cover" style={{backgroundImage: {}}}>
      <div className="container">
        <div className="row justify-content-center justify-content-md-start">
          <div className="col-10 col-md-6 static">
            <div className="owl-slide-text">
              <h2 className="owl-slide-animated owl-slide-title">The bedding was hardly able to cover it</h2>
              <div className="owl-slide-animated owl-slide-subtitle mb-3">
                One morning, when Gregor Samsa woke from troubled dreams, he found himself transformed in his bed into a horrible vermin.
              </div>
              <a className="btn btn-primary owl-slide-animated owl-slide-cta" href={car1} target="_blank" role="button">See Original Image</a>
            </div>
          </div>
        </div>
      </div>
    </div>{/*/owl-slide*/}
    <div className="owl-slide d-flex align-items-center cover" style={{backgroundImage: 'url(https://s3-us-west-2.amazonaws.com/s.cdpn.io/162656/owlcarousel2.jpg)'}}>
      <div className="container">
        <div className="row justify-content-center justify-content-md-start">
          <div className="col-10 col-md-6 static">
            <div className="owl-slide-text">
              <h2 className="owl-slide-animated owl-slide-title">Samsa was a travelling salesman.</h2>
              <div className="owl-slide-animated owl-slide-subtitle mb-3">
                It showed a lady fitted out with a fur hat and fur boa who sat upright, raising a heavy fur muff that covered the whole of her lower arm towards the viewer. Gregor then turned to look out the window at the dull weather.
              </div>
              <a className="btn btn-primary owl-slide-animated owl-slide-cta" href="https://unsplash.com/photos/Ijx8OxvKrgM" target="_blank" role="button">See Original Image</a>
            </div>
          </div>
        </div>
      </div>
    </div>{/*/owl-slide*/}
    <div className="owl-slide d-flex align-items-center cover" style={{backgroundImage: 'url(https://s3-us-west-2.amazonaws.com/s.cdpn.io/162656/owlcarousel3.jpg)'}}>
      <div className="container">
        <div className="row justify-content-center justify-content-md-start">
          <div className="col-10 col-md-6 static">
            <div className="owl-slide-text">
              <h2 className="owl-slide-animated owl-slide-title">A collection of textile samples.</h2>
              <div className="owl-slide-animated owl-slide-subtitle mb-3">
                He lay on his armour-like back, and if he lifted his head a little he could see his brown belly.
              </div>
              <a className="btn btn-primary owl-slide-animated owl-slide-cta" href="https://unsplash.com/photos/7uwbhGSH5Fg" target="_blank" role="button">See Original Image</a>
            </div>
          </div>
        </div>
      </div>
    </div>{/*/owl-slide*/}
  </div>
  <section>
    <div className="container">
      <div className="row">
        <div className="col p-5">
          <p>One morning, when Gregor Samsa woke from troubled dreams, he found himself transformed in his bed into a horrible vermin. He lay on his armour-like back, and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections. The bedding was hardly able to cover it and seemed ready to slide off any moment.</p>
          <p>His many legs, pitifully thin compared with the size of the rest of him, waved about helplessly as he looked. "What's happened to me? " he thought. It wasn't a dream. His room, a proper human room although a little too small, lay peacefully between its four familiar walls. A collection of textile samples lay spread out on the table - Samsa was a travelling salesman - and above it there hung a picture that he had recently cut out of an illustrated magazine and housed in a nice, gilded frame. It showed a lady fitted out with a fur hat and fur boa who sat upright, raising a heavy fur muff that covered the whole of her lower arm towards the viewer. Gregor then turned to look out the window at the dull weather.</p>
          <a className="btn btn-primary owl-slide-cta" href="http://www.blindtextgenerator.com/lorem-ipsum" target="_blank" role="button">Get Dummy Text</a>
        </div>
      </div>
    </div>
  </section>
</div>

  );
};
